			<script>


               function testParticipants(api, i) {
                   var participants=api.getNumberOfParticipants();
                   if (participants <= 1 && i < 7 * 1) {
                       //1min max test
                       i++;
                       console.log(i+" --- " +participants);
                       setTimeout(function() {
                           testParticipants(api,i);
                       }, 10000);
                   }
                   else if (participants <= 1 && i > 7 * 1 ) {
                       api.executeCommand('hangup');
                       return false
                   }
                   else {
                       J('#meet').css("display", "block");
                       api.executeCommand('displayName', 'Bourhil Mohammed-Amine');
                   }
               }

               function countparticipants(api){
                   return (api.getNumberOfParticipants() > 1);

               }
			   function pad(num, size) {
				   var s = num+"";
				   while (s.length < size) s = "0" + s;
				   return s;
			   }
			    J(function () {
			        var api;
			        const options = {
			            noSsl: false,
			            roomName: '1212f4a57715d4805dad56c4544597a4a00b1d82413a22ccef82a852478ca079',
			            parentNode: document.querySelector('#meetVideo')
			        };

                    const domain = "visio.rdv.gov.ma";

			        J('#btn_tele_medecine').click(function (e) {
						e.preventDefault();
						api = new JitsiMeetExternalAPI(domain, options);
						api.executeCommand('displayName', 'Bourhil Mohammed-Amine');
			        	//J('#meetVideo').append();
			        	J('#meetModal').css({'height':'90%','width': '90%','left': '5%','top':'5%','margin-left':'0px','right':'auto'});
						J('#meetModal').modal();
			        });

					J('#meetModal').on('hidden.bs.modal', function (e) {
						api.executeCommand('hangup');
						J('#meetVideo').empty();
					});

			        J('#hangup').click(function () {
			            if (confirm('Etes vous sure de vouloir quitter la consultation')) {
                            J('#meetModal').modal('hide');
			            }
			        });

					var countDownDate = new Date("2024-10-07 09:50:00").getTime();


					var clockInterval = setInterval(function() {

						var now = new Date().getTime();

						var distance = countDownDate - now;

						var days = Math.floor(distance / (1000 * 60 * 60 * 24));
						var hours = Math.floor((distance % (1000 * 60 * 60 * 24)) / (1000 * 60 * 60));
						var minutes = Math.floor((distance % (1000 * 60 * 60)) / (1000 * 60));

						if(document.getElementById("countdown") != null){
							if (distance < 0 || isNaN(days)) {

								document.getElementById("countdown").innerHTML = " 00j 00h 00m";
								clearInterval(clockInterval);
							}
							else{
								document.getElementById("countdown").innerHTML = pad(days,2) + "j  " + pad(hours,2) + "h  "+ pad(minutes,2) + "m";
							}
						}

						if(days == 0 && hours == 0 && minutes <= 10){
							//J('#btn_tele_medecine').prop("disabled", false);
						}else{
							//J('#btn_tele_medecine').prop("disabled", true);
						}

					}, 1000);

			    });
